let products = document.querySelector("main");


(function () {
    products.innerHTML ="";
    obj.map((item) => {
        const container = document.createElement('div');
        container.classList.add('container');
        container.innerHTML = `
        <span>${item.Category}</span>
        <img src="${item.img}"/>
        <h1 class="title">${item.title}</h1>
        <p>${item.content}</p>`;
        products.appendChild(container);
    })
})();

